window.deleteFilesWithAssets=function(){var o=yii.confirm;yii.confirm=function(t,e,i){var n=$(this);if(!n.data("delete-url"))return $.proxy(o,n,t,e,i)();bootbox.prompt({title:t,inputType:"checkbox",inputOptions:[{text:n.data("delete-message"),value:1}],callback:function(t){null!==t&&$.post(t.length?n.data("delete-url"):n.attr("href"),function(){n.closest("tr").remove()})}})}};